const COLORS = {
  primary: '#306060',
  secondary: '#88b3b5',
  white: '#FFF',
  dark: '#616161',
  light: '#f5f5f5',
  grey: '#a8a8a8',
  background: '#d0d8dc',
};

export default COLORS;
